const name = "shubham"
const lname = "chuadhari"
var date = new Date().toLocaleDateString()
var time = new Date().toLocaleTimeString()
var link = "https://www.youtube.com/"
var img1 = "https://picsum.photos/200/300"
ReactDOM.render(
  <>

    <h1 contentEditable="true">my name is {name}. last name is {lname} no is {Math.ceil(Math.random() * 10)}</h1>
    <h1>{date}</h1>
    <h1>{time}</h1>
    <a href={link} target="_blank" >Youtube</a>

    <img src={img1} alt="" />

  </>
  , document.getElementById("root"))
